import React, { useEffect, useState } from 'react';
import './BookedReservation';

const BookedReservations = () => {
    // Hardcoded reservation data
    const dummyReservations = [
        {
            name: "John Doe",
            email: "john.doe@example.com",
            phone: "+1 123 456 7890",
            location: "New York, USA",
            profilePicture: "https://randomuser.me/api/portraits/men/1.jpg",
            checkIn: "2025-03-25",
            checkOut: "2025-03-30",
            roomType: "Deluxe Suite",
            roomPrice: 250,
            message: "Looking forward to a relaxing stay!"
        },
        {
            name: "Jane Smith",
            email: "jane.smith@example.com",
            phone: "+1 987 654 3210",
            location: "Los Angeles, USA",
            profilePicture: "https://randomuser.me/api/portraits/women/2.jpg",
            checkIn: "2025-04-10",
            checkOut: "2025-04-15",
            roomType: "Standard Room",
            roomPrice: 120,
            message: "Please prepare a room with a king-size bed."
        },
        {
            name: "Alice Johnson",
            email: "alice.johnson@example.com",
            phone: "+1 555 123 4567",
            location: "Miami, USA",
            profilePicture: "https://randomuser.me/api/portraits/women/3.jpg",
            checkIn: "2025-05-01",
            checkOut: "2025-05-05",
            roomType: "Ocean View Suite",
            roomPrice: 300,
            message: "I need a quiet room with a nice view."
        },
        {
            name: "Bob Martin",
            email: "bob.martin@example.com",
            phone: "+1 321 654 9870",
            location: "Chicago, USA",
            profilePicture: "https://randomuser.me/api/portraits/men/4.jpg",
            checkIn: "2025-06-05",
            checkOut: "2025-06-10",
            roomType: "Executive Room",
            roomPrice: 200,
            message: "Please arrange an airport pickup."
        }
    ];

    const [reservations, setReservations] = useState([]);

    useEffect(() => {
        // Simulate API call delay
        setTimeout(() => {
            setReservations(dummyReservations);
        }, 1000);
    }, []);

    return (
        <div className="booked-reservations">
            <h1>Your Booked Reservations</h1>
            {reservations.length === 0 ? (
                <p>Loading reservations...</p>
            ) : (
                <ul>
                    {reservations.map((res, index) => (
                        <li key={index} className="reservation-card">
                            <div className="user-details">
                                <img
                                    src={res.profilePicture}
                                    alt={`${res.name}'s profile`}
                                    className="profile-picture"
                                />
                                <div className="user-info">
                                    <h2>{res.name}</h2>
                                    <p>Email: {res.email}</p>
                                    <p>Phone: {res.phone}</p>
                                    <p>Location: {res.location}</p>
                                </div>
                            </div>
                            <div className="reservation-details">
                                <p>Check-in: {res.checkIn}</p>
                                <p>Check-out: {res.checkOut}</p>
                                <p>Room Type: {res.roomType}</p>
                                <p>Price: ${res.roomPrice}</p>
                                <p>Message: {res.message || 'No message'}</p>
                            </div>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default BookedReservations;
